package com.ailk.sets.docs;public class Item {	private String name;	private String signature;	private String description;	public String getName() {		return name;	}	public void setName(String name) {		this.name = name;	}	public String getSignature() {		return signature;	}	public void setSignature(String signature) {		this.signature = signature;	}	public String getDescription() {		return description;	}	public void setDescription(String description) {		this.description = description;	}	@Override	public String toString() {		return "Constructor [name=" + name + ", signature=" + signature				+ ", description=" + description + "]";	}}